import { Link } from "react-router-dom";
const NavBar = () => {
    return ( 
        <div className="navbar">
           <div className="book_hub">
            <h1>Bookhub</h1>
           </div>
           <div className="links">
            <Link to='/adminPortal/'>Home</Link>
            <Link to='/adminPoratl/books'>Books</Link>
            <Link to='/adminPoratl/users'>Users</Link>
            <Link to='/adminPoratl/addbooks'>AddBooks</Link>
            <Link to='/adminPoratl/addusers'>AddUsers</Link>
           </div>
        </div>
     );
}
 
export default NavBar;
